    false,nt"url": null,nt"notes": "Results of taped-call black rail surveys
    of in-stream habitat within certain waterways in the central Sacramento / San Joaquin
    Delta during 1992 and 1993. TIME PERIOD COVERED. Surveys covered six survey days
    in 1992 (April 23-June5) and 10 days in 1993 (April 13-June 8). NUMBER OF RECORDS.
    267 survey stations were each surveyed once over the two year span. GEOGRAPHIC EXTENT
    OF RECORDS. Survey stations were located within designated Delta waterways, and
    distributed in a manner such that all emergent marsh, riparian, riparian, shrub,
    or other habitat was surveyed. DATA STRUCTURE. A shapefile. WHAT EACH RECORD REPRESENTS.
    Each record has a unique survey point where tape recorded calls of black rail were
    played following a survey protocol. The date and time the survey point was called
    and a y/n indicator of black rail presence at that point are included in each record.",nt"license_title":
